import React from "react";
import "./global.css";
import Routes from "./routes";

import LoggedProvider from "./contexts/LoggedContext";

import Logged from "./components/Logged";

function App() {
  return (
    <LoggedProvider>
      <Routes />
    </LoggedProvider>
  );
}

export default App;
